
export default {
    name: 'Form',
    props: {
        districtMode: String
    },
    mounted() {
        this.init();
    },
    data() {
        return {
            modeList: [
                {name: "新增/修改", value: "edit"},
                {name: "核算", value: "audit"},
                {name: "檢視", value: "view"},
            ],
            mode: "edit",
            panel: [0, 1, 2],
            imgSrcPrefix: "data:image/jpeg;base64,",
            signPreviewImgSrc: "",
            certificateList: [
                {
                    id: 1,
                    name: "身分證正面",
                    fileNo: "123",
                    imgSrc: "",
                    isIdCard: true,
                    isAdditional: false,
                },
                {
                    id: 2,
                    name: "身分證背面",
                    fileNo: "",
                    imgSrc: "",
                    isIdCard: true,
                    isAdditional: false,
                },
            ],
            certificateNo: 3,
            attachmentList: [],
            attachmentNo: 1,
            selectedAttachment: null,
            viewImageDialog: false,
            viewImageTitle: "",
            viewImageSrc: "",
            showModeSelect: true,
        }
    },
    methods: {
        init(){
            this.addAttachment();
            if(this.districtMode){
                this.mode = this.districtMode;
                this.showModeSelect = false;
            }
        },
        cleanCertificateImg(certificate) {
            certificate.imgSrc = null;
        },
        deleteCertificate(index){
            this.certificateList.splice(index, 1);
        },
        deleteAttachment(index){
            this.attachmentList.splice(index, 1);
        },
        addCertificate(){
            this.certificateList.push({
                id: this.certificateNo,
                name: "證件" + this.certificateNo,
                fileNo: "",
                imgSrc: "",
                isIdCard: false,
                isAdditional: true,
            });
            this.certificateNo++;
        },
        addAttachment(){
            this.attachmentList.push({
                id: this.attachmentNo,
                name: "附件" + this.attachmentNo,
                fileNo: "",
                imgSrc: "",
                file: null,
                useStamp: false,
                isSelecting: false,
            });
            this.attachmentNo++;
        },
        uploadFile(attachment, index) {
            this.selectedAttachment = attachment;
            this.selectedAttachment.isSelecting = true
            window.addEventListener('focus', () => {
                this.selectedAttachment.isSelecting = false
            }, { once: true })
      
            this.$refs.uploaders[index].click()
        },
        onFileChanged(e) {
            this.selectedAttachment.file = e.target.files[0];
            
            if(this.selectedAttachment.file.type.indexOf("image") > -1){
                let reader = new FileReader();
                reader.onload = (e) =>{
                    this.selectedAttachment.imgSrc = e.target.result;
                };
                reader.readAsDataURL(this.selectedAttachment.file);
            }
        },
        viewImage(image){
            this.viewImageTitle = image.name;
            if(image.imgSrc.indexOf("data:image") > -1){
                this.viewImageSrc = image.imgSrc;
            }
            else{
                this.viewImageSrc = this.imgSrcPrefix + image.imgSrc;
            }
            this.viewImageDialog = true;
        },
        hideFiveSec(){
            this.showModeSelect = false;
            setTimeout(() => this.showModeSelect = true, 5000);
        }
    }
}